const Ham_Submenu = ({ items }) => {
  if (!Array.isArray(items)) {
    return null;
  }

  return (
    <div>
      {items.map((item) => (
        <div>{item.label}</div>
      ))}
    </div>
  );
};

export default Ham_Submenu;
